import React from 'react';
import logo from './logo.svg';
import './App.css';

const list = [
  {
    title: 'react',
    url:'http//:react.org',
    Author: 'jordan walker',
    num_comment : 4,
    point:3,
    objectID: 0,
  },
  {
    title: 'movingMedia',
    url: 'movingMedia.fr',
    Author: 'joelPOKAM',
    num_comment : 5,
    point : 4,
    objectID:1,
  }
]

function App() {
  return (
    <div className="App">
      {list.map(function (item,) {
        return (
          <div>
           <a href={item.url}>{item.title}</a>
           <span>{item.Author}</span>
           <span>{item.num_comment}</span>
           <span>{item.points}</span>
          </div>
        );
      })}
    </div>
  );
}

export default App;

